import React from 'react';
import './welcomePage.css';  // Changed from absolute to relative path
import logo from '../assets/images/logo.png';

const WelcomePage = () => {  // Changed to PascalCase to match export
  return (
    <div className="welcome-container">
      <h1 className="welcome-title">Welcome To</h1>
      <div className="logo-section">
        <img src={logo} alt="SafeTrack Logo" className="logo" />
        <h2 className="brand-text">Safe<span>Track</span></h2>
      </div>
      <p className="subtitle">Ensuring Safe Food Practices with Smart Inspections</p>
      <div className="button-group">
        <button className="login-btn">Login</button>
        <button className="register-btn">PHI Register</button>
      </div>
    </div>
  );
};

export default WelcomePage;
